import React from 'react'
import './Contact.css'
function Contact() {

    const onSubmitHandler = (event) => {
        event.preventDefault();
        console.log(event.target.fname.value)
        console.log("Submit")
    };

    return (
        <div className='contact'>
            <div className='container'>
            <h3 className='special-heading'>Contact</h3>
                <p>We are born to create</p>
                <form onSubmit={onSubmitHandler}>
                    <input type='text' name="fname" placeholder="Enter The First Name.."/>
                    <input type='text' name="lame" placeholder="Enter The Last Name.."/>
                    <input type='email' name="email" placeholder="Enter Your Email.."/>
                    <textarea type="text" name="mesage" placeholder ="Enter Your Masage"/>
                    <button type='submit' name="submit">Submit</button>
                </form>
            </div>
        </div>
    )
}

export default Contact
